import React from 'react';
import { Link } from 'react-router-dom';
import logo from '../assests/basilurlogo.png'; // Import logo

const AdminPage = () => {
  return (
    <div
      className="font-sans min-h-screen flex flex-col justify-between"
      style={{
        backgroundColor: '#FFFFFF', // White background for the page
        margin: 0, // Remove any margin for the body
        padding: 0, // Remove any padding
      }}
    >
      {/* Header */}
      <header
        className="flex items-center justify-center p-2 mx-auto"
        style={{
          backgroundColor: '#191919', // Black header background
          color: '#FFFFFF', // White font color
          borderRadius: '30px', // Rounded header corners
          height: '50px', // Smaller header height
          width: '85%', // Header width
          marginTop: '20px', // Space from top
          boxShadow: '0 4px 10px rgba(0, 0, 0, 0.1)', // Subtle shadow
          paddingTop: '5px', // Adjust padding for compact header
          paddingBottom: '5px', // Adjust padding for compact header
        }}
      >
        {/* Logo */}
        <img
          src={logo}
          alt="Logo"
          className="mr-4"
          style={{
            width: '40px', // Logo size
            height: '40px',
            objectFit: 'contain',
          }}
        />
        {/* Title */}
        <h1
          className="text-lg font-bold flex-1 text-center"
          style={{
            color: '#FFFFFF', // White text color
          }}
        >
          Admin Dashboard
        </h1>
      </header>

      {/* Main Content Section */}
      <main className="flex-1 flex justify-center items-center">
        <div
          className="p-8 rounded-lg shadow-lg w-96"
          style={{
            backgroundColor: '#FFFFFF', // Solid white background
            borderRadius: '16px', // Rounded corners
            border: '1px solid rgba(25, 25, 25, 0.1)', // Subtle border
            boxShadow: '0 4px 10px rgba(0, 0, 0, 0.1)', // Subtle shadow
          }}
        >
          <h2
            className="text-2xl mb-6 font-semibold"
            style={{
              color: '#191919', // Black text for the title
              textAlign: 'center',
            }}
          >
            Admin Options
          </h2>
          <div
            className="flex justify-center items-center"
            style={{
              width: '100%', // Full width to align the buttons correctly
              marginTop: '20px',
            }}
          >
            {/* Navigation Links with Buttons */}
            <Link to="/add-freight-agent">
              <button
                className="p-3 rounded-md border-2 text-lg"
                style={{
                  borderColor: '#FF4D00', // Orange border color
                  backgroundColor: 'transparent',
                  color: '#FF4D00', // Orange text
                  transition: 'background-color 0.3s ease, color 0.3s ease',
                }}
                onMouseOver={(e) => {
                  e.target.style.backgroundColor = '#FF4D00'; // Orange background on hover
                  e.target.style.color = '#FFFFFF'; // White text on hover
                }}
                onMouseOut={(e) => {
                  e.target.style.backgroundColor = 'transparent'; // Transparent background
                  e.target.style.color = '#FF4D00'; // Orange text
                }}
              >
                Add Freight Agent
              </button>
            </Link>

            <span className="mx-2 text-orange-500">|</span> {/* Vertical line separator */}

            <Link to="/add-freight-coordinator">
              <button
                className="p-3 rounded-md border-2 text-lg"
                style={{
                  borderColor: '#FF4D00', // Orange border color
                  backgroundColor: 'transparent',
                  color: '#FF4D00', // Orange text
                  transition: 'background-color 0.3s ease, color 0.3s ease',
                }}
                onMouseOver={(e) => {
                  e.target.style.backgroundColor = '#FF4D00'; // Orange background on hover
                  e.target.style.color = '#FFFFFF'; // White text on hover
                }}
                onMouseOut={(e) => {
                  e.target.style.backgroundColor = 'transparent'; // Transparent background
                  e.target.style.color = '#FF4D00'; // Orange text
                }}
              >
                Add Freight Coordinator
              </button>
            </Link>

            <span className="mx-2 text-orange-500">|</span> {/* Vertical line separator */}

            <Link to="/add-main-user">
              <button
                className="p-3 rounded-md border-2 text-lg"
                style={{
                  borderColor: '#FF4D00', // Orange border color
                  backgroundColor: 'transparent',
                  color: '#FF4D00', // Orange text
                  transition: 'background-color 0.3s ease, color 0.3s ease',
                }}
                onMouseOver={(e) => {
                  e.target.style.backgroundColor = '#FF4D00'; // Orange background on hover
                  e.target.style.color = '#FFFFFF'; // White text on hover
                }}
                onMouseOut={(e) => {
                  e.target.style.backgroundColor = 'transparent'; // Transparent background
                  e.target.style.color = '#FF4D00'; // Orange text
                }}
              >
                Add Main User
              </button>
            </Link>
          </div>
        </div>
      </main>

      {/* Footer */}
      <footer
        className="p-4 text-center mt-auto"
        style={{
          backgroundColor: 'transparent', // Transparent background
          color: '#191919', // Black text
          fontSize: '14px',
          marginTop: '20px',
        }}
      >
        Â© {new Date().getFullYear()} Admin Dashboard. All Rights Reserved.
      </footer>
    </div>
  );
};

export default AdminPage;
